  display: "flex",
  flexDirection: "row-reverse",
});

export default function Main() {
  return (
    <>
      <Title>Hello world</Title>
      <SubTitle>Just testing</SubTitle>
      <ButtonGroup>
        <Button />
      </ButtonGroup>
    </>
  );
}
